column8:
日本製の高品質な牛革の小銭入れ、コインケースです。<br>
三方にファスナーがついて大きく開き、中身を取り出しやすくしています。<br>
内部は中仕切りで三室に分かれています。<br>
<br>素材は丈夫でキズがつきにくい、角シボ型押し牛革を使用。附属部分にはヌメ革を使用しています。<br>
<br>
■ SIZE : H 7.5cm × W 10cm × D 1.5cm<br>
■ MATERIAL : 牛革（外側）・シャンタン生地（裏地）・合皮（マチ部分）<br>
■ COLOR : オレンジ　グリーン　ネイビー　チョコ　ブラック<br><br>

★革の質感の目安★（５段階）<br>
柔らかい　□□□□■　かたい<br>
なめらか　□□□□■　ざらざら<br>
<br><br>
<p class="searchwords">＜商品名＞<br>【ギフト プレゼント】日本製 本革 ラウンドファスナー 小銭入れ プリズム（角シボ型押し牛革）【メンズ コインケース 革 レザー コインケース 財布 コインケース 一部ヌメ革 コインケース メンズ 紳士 男性用 コインケース じゃばら ジャバラ】</p><link rel="stylesheet" href="http://www.rakuten.ne.jp/gold/gobangai/css/shop.css" type="text/css" media="all" />

